    false,nt"url": null,nt"notes": "This 1993 Annual Big Game Hunting Program
    outlines the reasons and regulations for white-tailed deer hunting on Parker River
    National Wildlife Refuge. The white-tailed deer population has grown to exceed the
    recommended carrying capacity for the Island. The Refuge will be closed for 4.5
    days in order to carry out the controlled deer hunt. Limited hunting will be allowed
    by permit only, and each hunter will be assigned a hunt day and a zone. Rules and
    procedures for hunter selection are attached as well as a list of hunt zone assignments.",nt"owner_org":
